  console.log(errNum);
  return (
    <div>
      <h1>Error</h1>
      <h2>Please Post this error to the Community post</h2>
      <h4>Error Description: </h4>
      <h5 className="errMsg"> {errMsg}</h5>
      <Button variant="outline-danger" href='/home'>Back Home</Button>{' '}
    </div>
  );
};

export default ErrorPage;
